INSERT INTO `faqs` (`id`, `question`, `answer`, `category`, `status`, `created_at`, `updated_at`) VALUES
	(1, 'Could you please guide me on how to place an order on your website?', '<ul style="margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 0px 13px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; font-family: Lato, sans-serif;"><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; color: var(--colorTextBody);">To place an order, please select the product you wish to purchase.</li><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; color: var(--colorTextBody);">Please select a suitable size from the dropdown menu.</li><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; color: var(--colorTextBody);">Select a quantity and click "Add to Cart".</li><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; color: var(--colorTextBody);">The checkout button will appear in a slide-in window on the right-hand side, along with your order total.</li><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; color: var(--colorTextBody);">To proceed with the payment and delivery details, please click on the "checkout" button.</li></ul>', 2, 1, '2024-11-30 03:46:43', '2025-03-24 08:09:54'),
	(3, 'How can I apply a promo code?', '<ul style="margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 0px 13px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; font-family: Lato, sans-serif;"><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; color: var(--colorTextBody);">When you check out, you can use discount promo codes. Look for the tab on the right side after you enter your information.</li></ul>', 2, 1, '2025-03-24 08:10:11', '2025-03-24 08:10:11'),
	(4, 'I have made an order. What will happen next?', '<ul style="margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 0px 13px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; font-family: Lato, sans-serif;"><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; color: var(--colorTextBody);">After you place an order on suratikart.com, you will receive a confirmation email.</li><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; color: var(--colorTextBody);">Your order is on its way and you will receive regular updates about its delivery from our warehouse.</li><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; color: var(--colorTextBody);">We would like to inform you that your product has been securely packed and is now in transit with our reliable delivery partners.</li><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; color: var(--colorTextBody);">Once you have completed your purchase, we will ship your item to the location you have specified.</li><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; color: var(--colorTextBody);">You will receive a tracking number which can be used to track your order on our courier partner’s website.</li><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; color: var(--colorTextBody);">You can track your order using the provided tracking ID until it\'s delivered to you.</li></ul>', 2, 1, '2025-03-24 08:10:28', '2025-03-24 08:10:28'),
	(5, 'Is it safe to use my credit/debit card for shopping?', '<ul style="margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 0px 13px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; font-family: Lato, sans-serif;"><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; color: var(--colorTextBody);">To provide you with a safe and secure shopping experience, we process all transactions made with credit cards, debit cards, and net banking through an encrypted connection. This ensures that your transactional details remain confidential at all times.</li></ul>', 3, 1, '2025-03-24 08:11:08', '2025-03-24 08:11:08'),
	(6, 'What should I do if my debit/credit card has been compromised while making an online payment?', '<ul style="margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 0px 13px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; font-family: Lato, sans-serif;"><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; color: var(--colorTextBody);">We do not store or collect your card information. If you suspect unauthorized activity on your card, report it immediately to your bank.</li></ul>', 3, 1, '2025-03-24 08:11:25', '2025-03-24 08:11:25'),
	(7, 'I am worried about the security of entering my credit card details online.', '<ul style="margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 0px 13px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; font-family: Lato, sans-serif;"><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; color: var(--colorTextBody);">Please be informed that we do not collect or retain your complete card details. Once you enter the card details, you will be redirected to a secure payment site.</li><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; color: var(--colorTextBody);">Your card-issuing bank authorizes or declines transactions. We process or reject based on their response. We never receive or store your card details.</li><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; color: var(--colorTextBody);">Please note that we do not collect or keep your full card details. When you provide your card details, you will be directed to a secure payment page.</li><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; color: var(--colorTextBody);">Your card issuing bank either authorizes or rejects the transaction. Based on their decision, we either process or reject the order. We do not receive or store your card details at any point.</li><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; color: var(--colorTextBody);">Please note that we do not store your complete card details. When entering your card information, you will be redirected to a secure payment site.</li><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; color: var(--colorTextBody);">Your bank authorizes or denies the transaction. We don\'t receive or store your card details.</li><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; color: var(--colorTextBody);">We don\'t store your card details. After you enter them, you\'ll be redirected to a secure site. Your bank decides to approve or reject the transaction. We never receive or store your card details.</li></ul>', 3, 1, '2025-03-24 08:11:42', '2025-03-24 08:11:42'),
	(8, 'Could you please let me know how many days it will take for my order to be delivered?', '<ul style="margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 0px 13px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; font-family: Lato, sans-serif;"><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; color: var(--colorTextBody);">Get ready to receive your order right at your doorstep within just 7-10 working days! We guarantee that you\'ll be satisfied with our speedy delivery service. Sit back and relax while we take care of everything.</li></ul>', 4, 1, '2025-03-24 08:12:02', '2025-03-24 08:12:02'),
	(9, 'What happens if I am not available when you deliver my order?', '<ul style="margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 0px 13px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; font-family: Lato, sans-serif;"><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; color: var(--colorTextBody);">Our delivery service providers will attempt delivery three times before the product is returned to our warehouse for all online orders.</li><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; color: var(--colorTextBody);">When you choose the Cash on Delivery option while placing an order, the delivery service provider will usually call you before making a delivery attempt. If you are not available at the time of the delivery attempt, our delivery service provider will automatically make three more attempts. If you are still not available, the product will be returned to our warehouse.</li></ul>', 4, 1, '2025-03-24 08:12:24', '2025-03-24 08:12:24'),
	(10, 'I am located out of India. Do you ship internationally?', '<p><span style="font-family: Lato, sans-serif;">Yes, we do ship internationally. We’ll happily deliver your orders.</span></p>', 4, 1, '2025-03-24 08:12:48', '2025-03-26 02:09:51'),
	(11, 'How do I reset my account password?', '<p>If you\'ve forgotten your password, click on the "Forgot Password" link on the login page. Enter your registered email address, and we\'ll send you a link to reset your password. Follow the instructions in the email to set a new password.</p>', 6, 1, '2025-03-26 03:22:39', '2025-03-26 03:22:39'),
	(12, 'How can I track my order?', '<p data-start="534" data-end="841" class="">To track your order, log in to your account and visit the "Order History" section. Click on the order you want to track, and you\'ll find the tracking number and link to the shipping carrier\'s website. You can also use the tracking number in the shipping confirmation email to track your order.</p>', 6, 1, '2025-03-26 03:23:02', '2025-03-26 03:23:02'),
	(13, 'What is your return policy?', '<p>We accept returns within 30 days of purchase. The items must be unused and in their original packaging. If you are not satisfied with your purchase, please contact our customer service team to initiate a return and refund.</p>', 5, 1, '2025-03-26 03:23:51', '2025-03-26 03:23:51'),
	(14, 'How do I request a refund for a damaged or defective item?', '<p>If you received a damaged or defective item, please contact us within 3 days of delivery. Provide photos of the item showing the damage or defect, and our team will guide you through the process of receiving a replacement or refund. In most cases, we will arrange for the item to be returned at no additional cost.</p>', 5, 1, '2025-03-26 03:24:48', '2025-03-26 03:24:58'),
	(15, 'Do you offer gift cards?', '<p>No, We are currently for offer any gift cards.</p>', 1, 1, '2025-03-26 03:26:11', '2025-03-26 03:26:11'),
	(16, 'How can I subscribe to your newsletter?', '<p>To subscribe to our newsletter, scroll to the bottom of our homepage and enter your email address in the subscription box. You’ll receive updates on new products, special promotions, and exclusive offers.</p>', 1, 1, '2025-03-26 03:26:30', '2025-03-26 03:26:30');
