	(6, 'uploads/media_67cbbbac13251.jpg', 'uploads/media_67cbbbac13c2b.jpg', NULL, 'Abstract Drape Dress', 'abstract-drape-dress', NULL, 18, 8, '3', 'The Abstract Print Satin Drape Dress embodies elegance with its vibrant abstract patterns on high-quality satin. Its draped silhouette gracefully flows, complemented by intricate shoulder detailing for a touch of sophistication. Crafted for comfort and style, this dress embraces the body while allowing effortless movement. Versatile and chic, it\'s perfect for cocktail parties, formal gatherings, or evening events, offering a luxurious feel and a unique, eye-catching design that elevates any occasion.', '<span style="box-sizing: inherit; color: rgb(100, 99, 99); font-family: Poppins, sans-serif; font-size: 16px; letter-spacing: 2px; background-color: rgb(252, 252, 252);">Fabric type</span><span style="color: rgb(100, 99, 99); font-family: Poppins, sans-serif; font-size: 16px; letter-spacing: 2px; background-color: rgb(252, 252, 252);">&nbsp;: SATIN</span><br style="box-sizing: inherit; color: rgb(100, 99, 99); font-family: Poppins, sans-serif; font-size: 16px; letter-spacing: 2px; background-color: rgb(252, 252, 252);"><span style="box-sizing: inherit; color: rgb(100, 99, 99); font-family: Poppins, sans-serif; font-size: 16px; letter-spacing: 2px; background-color: rgb(252, 252, 252);">Transparency of fabric: OPAQUE<br style="box-sizing: inherit;">The model is 5\'6" in height and waist 34" and is wearing size L</span><br style="box-sizing: inherit; color: rgb(100, 99, 99); font-family: Poppins, sans-serif; font-size: 16px; letter-spacing: 2px; background-color: rgb(252, 252, 252);">', '2025-03-08', '2025-03-08', 2, NULL, NULL, NULL, 1, '2025-03-07 22:08:20', '2025-03-07 22:08:20'),
