	(43, 'uploads/media_67e76e0f74d05.jpg', 'uploads/media_67e76e0f7735f.jpg', NULL, 'Stunning Salmon Soft Organza Anarkali Suit Set with Lace Border Dupatta', 'stunning-salmon-soft-organza-anarkali-suit-set-with-lace-border-dupatta', NULL, 54, 28, '1', 'Add grace and sophistication to your ethnic wardrobe with this Soft Organza Anarkali Suit Set, designed for style and comfort. This outfit is perfect for weddings, festive celebrations, and cultural events, featuring a fully flared Anarkali with churidar sleeves and a padded bust. Complemented by a beautifully crafted organza dupatta with lace borderwork and comfortable cotton pants, this ensemble is ready to wear and effortlessly elegant.', '<h3 style="margin: 10px 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; outline: 0px; color: rgb(0, 0, 0); font-family: var(--heading-font-family); line-height: var(--heading_line_height); font-weight: var(--heading-font-weight); font-size: 20px !important;">Anarkali Features:</h3><ul style="margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 0px 13px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; font-family: Lato, sans-serif;"><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px;"><strong style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px;">Fabric:</strong>&nbsp;Crafted from soft organza fabric for a lightweight and flowy look.</li><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent