0); font-family: var(--heading-font-family); line-height: var(--heading_line_height); font-weight: var(--heading-font-weight); font-size: 20px !important;">Dupatta Features:</h3><ul style="margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 0px 13px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; font-family: Lato, sans-serif;"><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px;"><strong style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px;">Fabric:</strong>&nbsp;Soft organza with a delicate drape and elegant finish.</li><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px;"><strong style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px;">Work:</strong>&nbsp;Lace border detailing adds sophistication and charm.</li><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px;"><strong style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px;">Width:</strong>&nbsp;27-inch shawl-style design for versatile styling.</li><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px;"><strong style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px;">Length:</strong>&nbsp;2.3 meters, perfect for traditional and modern drapes.</li></ul><h3 style="margin: 10px 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; outline: 0px; color: rgb(0, 0, 0); font-family: var(--heading-font-family); line-height: var(--heading_line_height); font-weight: var(--heading-font-weight); font-size: 20px !important;">Pants Features:</h3><ul style="margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 0px 13px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; font-family: Lato, sans-serif;"><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px;"><strong style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px;">Fabric:</strong>&nbsp;Free-size, fully stitched cotton pants for comfort and ease of movement.</li></ul><h3 style="margin: 10px 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; outline: 0px; color: rgb(0, 0, 0); font-family: var(--heading-font-family); line-height: var(--heading_line_height); font-weight: var(--heading-font-weight); font-size: 20px !important;">Package Contains:</h3><ul style="margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 0px 13px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px; font-family: Lato, sans-serif;"><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px;">1 Soft Organza Anarkali</li><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px;">1 Soft Organza Dupatta with Lace Border Work</li><li style="margin: 0px; padding: 0px; vertical-align: baseline; scrollbar-width: thin; scrollbar-color: rgb(221, 221, 221) transparent; -webkit-tap-highlight-color: transparent; border: 0px;">1 Pair of Fully Stitched Cotton Pants</li></ul>', '2025-03-29', '2025-03-29', 2, NULL, NULL, NULL, 1, '2025-03-28 22:20:39', '2025-03-28 22:20:39'),
	(44, 'uploads/media_67e76f988ecdb.jpg', 'uploads/media_67e76f988fbb9.webp', NULL, 'Indigo Modal Festive Anarkali Fusion Suit Set', 'indigo-modal-festive-anarkali-fusion-suit-set', NULL, 54, 10, '1', 'Revamp your festive wardrobe with a touch of modern elegance in this stunning fusion wear suit set from Biba, handpicked by Kriti Sanon. This ensemble features a chic crop top paired with eye-catching contrasting palazzos and a layered Anarkali-style shrug, perfect for making a bold statement at any daytime event. Crafted from modal fabric, it promises both unparalleled comfort and sophisticated style.', '<p style="line-height: 18px; font-family: workSans-regular; color: rgb(34, 34, 34); margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px;"><span style="line-height: 18px; font-weight: bolder;">Top Details:</span></p><ul style="line-height: 18px; font-family: workSans-regular; color: rgb(34, 34, 34);"><li style="line-height: 18px;">Adorned with intricate geometric prints for a touch of contemporary charm</li><li style="line-height: 18px;">Strappy design for versatile styling options</li><li style="line-height: 18px;">Concealed zip closure for a seamless and comfortable fit</li></ul><p style="line-height: 18px; font-family: workSans-regular; color: rgb(34, 34, 34); margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px;"><span style="line-height: 18px; font-weight: bolder;">Bottom Details:</span></p><ul style="line-height: 18px; font-family: workSans-regular; color: rgb(34, 34, 34);"><li style="line-height: 18px;">Features an all-over printed pattern for a cohesive and stylish look</li><li style="line-height: 18px;">Elasticated waistband for enhanced comfort and ease</li></ul><p style="line-height: 18px; font-family: workSans-regular; color: rgb(34, 34, 34); margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px;"><span style="line-height: 18px; font-weight: bolder;">Shrug Details:</span></p><ul style="line-height: 18px; font-family: workSans-regular; color: rgb(34, 34, 34);"><li style="line-height: 18px;">Adorned with ethnic motifs and dazzling sequin detailing throughout</li><li style="line-height: 18px;">Sleek V-neckline for a sophisticated silhouette</li><li style="line-height: 18px;">Elegant 3/4 sleeves for both refinement and comfort</li><li style="line-height: 18px;">Cut-out detailing on the hemline adds a unique, enchanting touch</li></ul>', '2025-03-29', '2025-03-29', 2, NULL, NULL, NULL, 1, '2025-03-28 22:27:12', '2025-03-28 22:27:12'),
	(45, 'uploads/media_67e772bc356a5.jpg', 'uploads/media_67e772bc368c6.jpg', NULL, 'Neha Bhandari Elegant White Chinon Anarkali Suit Set', 'neha-bhandari-elegant-white-chinon-anarkali-suit-set', 'YUH-06', 54, 10, '', 'Exude elegance and sophistication with this white chinon anarkali suit set from Suratikart. Featuring intricate thread and sequin embroidery, delicate lace borders, and dori latkan detailing, this ensemble is perfect for weddings, festive celebrations, and formal occasions.', NULL, '2025-03-29', '2025-03-29', 1, 7000, 2499, 0, 1, '2025-03-28 22:40:36', '2025-03-28 22:40:36'),
	(46, 'uploads/media_67e7731e4f040.jpg', 'uploads/media_67e7731e4f7d8.jpg', NULL, 'Green Color Georgette Anarkali Suit with Dupatta', 'green-color-georgette-anarkali-suit-with-dupatta', NULL, 54, 10, '2', 'Radiate elegance with this Green Color Anarkali Suit, designed for effortless style and sophistication. Crafted from premium heavy fox georgette fabric, this outfit features a flattering V-neckline, churidar sleeves, and a 4-meter flair for a graceful silhouette. Fully lined with pure micro cotton and detailed with canvas patta, it pairs beautifully with a 2.3-meter dupatta adorned with fancy lace work. Perfect for weddings, festive celebrations, and cultural gatherings.', NULL, '2025-03-29', '2025-03-29', 2, NULL, NULL, NULL, 1, '2025-03-28 22:42:14', '2025-03-28 22:42:14'),
	(47, 'uploads/media_67e7741310212.jpg', 'uploads/media_67e77413107e7.jpg', NULL, 'Elegant Black Embroidered Georgette Suit Set with Dupatta', 'elegant-black-embroidered-georgette-suit-set-with-dupatta', NULL, 54, 28, '1', 'Elevate your ethnic wardrobe with our Black Embroidered Georgette Suit Set, a perfect blend of style and grace. This stunning kali-cut anarkali features intricate all-over embroidery, a flattering square neckline, and full-length sleeves. Paired with comfortable cotton pants and a lightweight georgette dupatta, this outfit is ideal for weddings, festive celebrations, and formal gatherings.', NULL, '2025-03-29', '2025-03-29', 2, NULL, NULL, NULL, 1, '2025-03-28 22:46:19', '2025-03-28 22:46:19'),
	(48, 'uploads/media_67e9326ebb32d.jpg', 'uploads/media_67e9326ebe5d1.jpg', NULL, 'Beet Red Flower Print Organza Silk Anarkali Suit Set', 'beet-red-flower-print-organza-silk-anarkali-suit-set', NULL, 54, 10, '2', 'Make a striking statement with this beet red anarkali suit set, crafted from luxurious organza silk with an exquisite floral print. The Anarkali gown features intricate Badla jari handwork, full-length sleeves, and a 4-meter flair for a regal look. Paired with a soft organza silk dupatta adorned with gota patti lace and micro cotton silk pants, this ensemble perfectly blends elegance and comfort. It is ideal for weddings, festive events, and cultural gatherings.', NULL, '2025-03-30', '2025-03-30', 2, NULL, NULL, NULL, 1, '2025-03-30 06:30:46', '2025-03-30 06:30:46'),
	(49, 'uploads/media_67e9350ae7829.jpg', 'uploads/media_67e9350ae7f40.jpg', NULL, 'Off-White and Black Cotton Printed Tiered Dress', 'off-white-and-black-cotton-printed-tiered-dress', NULL, 54, 10, '', 'Exude effortless grace with our off-white and black printed tiered dress, the ultimate addition to your summer wardrobe. Crafted from pure cotton, this dress is designed for maximum comfort and breathability, making it the perfect choice for sunny outings and casual adventures.', NULL, '2025-03-30', '2025-03-30', 2, NULL, NULL, NULL, 1, '2025-03-30 06:41:54', '2025-03-30 06:41:54');
